    <script id="tontit-data" type="application/json">{"type": "FeatureCollection", "features": [{"id": "0", "type": "Feature", "properties": {"wkt_geom": "Polygon ((381251.64816498302388936 6699596.91545011755079031, 381271.05646402214188129 6699647.80492712557315826, 381346.5909110969514586 6699607.95723446924239397, 381368.09758866159245372 6699546.288295803591609, 381251.64816498302388936 6699596.91545011755079031))", "fid": 1, "Nimi": "tontti_1", "logo": "Astra_logo.png", "tontti_name": "Astra", "title": "ASTRA \u2013 T\u00e4htien kynnyksell\u00e4", "text": "Ensimm\u00e4isen\u00e4 Vuolteen tonttiriviss\u00e4 kohoaa Astra \u2013 rinne, joka kurottaa kohti taivasta. Sen mets\u00e4inen luonto, rauhallinen sijainti ja nopea yhteys tielle tekev\u00e4t siit\u00e4 hiljaisen t\u00e4hyst\u00e4j\u00e4n muiden ylle. Vaikka n\u00e4kym\u00e4t j\u00e4\u00e4v\u00e4t hillitymmiksi, Astra on paikka, jossa oma polku t\u00e4htiin alkaa.", "logo_bounds": [[6699587.340357967, 381298.1665044442], [6699609.278074229, 381318.1665044442]]}, "geometry": {"type": "Polygon", "coordinates": [[[381251.648164983, 6699596.915450118], [381271.05646402214, 6699647.804927126], [381346.59091109695, 6699607.957234469], [381368.0975886616, 6699546.288295804], [381251.648164983, 6699596.915450118]]]}}, {"id": "1", "type": "Feature", "properties": {"wkt_geom": "Polygon ((381346.97700274270027876 6699608.7294177608564496, 381264.332328921998851 6699651.77827968541532755, 381288.87952332128770649 6699741.13774779718369246, 381333.08291682985145599 6699672.79879621881991625, 381336.55252830794779584 6699646.56639904249459505, 381346.97700274270027876 6699608.7294177608564496))", "fid": 2, "Nimi": "tontti_2", "logo": "Solace_logo.png", "tontti_name": "Solace", "title": "SOLACE \u2013 Tyyneyden turvasatama", "text": "Solace sijaitsee rauhan ja saavutettavuuden risteyksess\u00e4. Se tarjoaa tasaisen, helposti rakennettavan maaston sek\u00e4 maisemat, jotka helliv\u00e4t mielt\u00e4 joka aamu. Mets\u00e4n suojasta avautuu rauhallinen n\u00e4kym\u00e4 maailmaan \u2013 Solace on paikka, jossa syd\u00e4n l\u00f6yt\u00e4\u00e4 levon.", "logo_bounds": [[6699657.8841187805, 381293.7581292596], [6699679.821835043, 381313.7581292596]]}, "geometry": {"type": "Polygon", "coordinates": [[[381346.9770027427, 6699608.729417761], [381264.332328922, 6699651.778279685], [381288.8795233213, 6699741.137747797], [381333.08291682985, 6699672.798796219], [381336.55252830795, 6699646.5663990425], [381346.9770027427, 6699608.729417761]]]}}, {"id": "2", "type": "Feature", "properties": {"wkt_geom": "Polygon ((381333.34604619775200263 6699672.90772606059908867, 381278.75546310027129948 6699758.26128190942108631, 381302.94455564446980134 6699781.93580622412264347, 381375.05365625058766454 6699711.65628241654485464, 381335.98364988958928734 6699652.84125091414898634, 381333.34604619775200263 6699672.90772606059908867))", "fid": 3, "Nimi": "tontti_3", "logo": "Leto_logo.png", "tontti_name": "Leto", "title": "LETO \u2013 Valon ja n\u00e4kymien kohta", "text": "Leto, kuun \u00e4iti, avaa silm\u00e4ns\u00e4 yli kumpuilevien peltojen ja tummien metsien. T\u00e4m\u00e4 tontti tarjoaa monipuolisuutta: mets\u00e4inen turva yhdistyy avoimeen n\u00e4kym\u00e4\u00e4n. Rakentaminen sujuu pehme\u00e4sti ja auringonlaskut lankeavat t\u00e4ydellisesti tulevan kodin ikkunoihin.", "logo_bounds": [[6699712.369168496, 381317.39402360574], [6699734.306884758, 381337.39402360574]]}, "geometry": {"type": "Polygon", "coordinates": [[[381333.34604619775, 6699672.907726061], [381278.7554631003, 6699758.261281909], [381302.94455564447, 6699781.935806224], [381375.0536562506, 6699711.656282417], [381335.9836498896, 6699652.841250914], [381333.34604619775, 6699672.907726061]]]}}, {"id": "3", "type": "Feature", "properties": {"wkt_geom": "Polygon ((381375.19920030038338155 6699711.80182646587491035, 381303.0585932158282958 6699782.04984379559755325, 381331.33991091913776472 6699809.30482335668057203, 381374.4344777822261676             // --- 1. SETUP MAP & COORDINATE SYSTEMS ---
            const proj4_ETRS_TM35FIN = '+proj=utm +zone=35 +ellps=GRS80 +units=m +no_defs +type=crs';
            const proj4_WGS84 = 'EPSG:4326';
            const coordsToLatLng = (coords) => {
                if (!coords || coords.length < 2) {
                    console.error("Invalid coordinates:", coords);
                    return null;
                }
                return L.latLng(coords[1], coords[0]);
            };

            const map = L.map('map', {
                crs: L.CRS.Simple,
                minZoom: -5,
                zoomControl: true
            });

            // --- 2. SETUP LAYER PANES ---
            map.createPane('backgroundPane').style.zIndex = 240;
            map.createPane('detailedMapPane').style.zIndex = 250;
            map.createPane('hiresMapPane').style.zIndex = 260;
            map.createPane('contoursPane').style.zIndex = 380;
            map.createPane('roadPane').style.zIndex = 390;
            map.createPane('tontitPane').style.zIndex = 400;
            map.createPane('tonttiLogoPane').style.zIndex = 410;
            map.createPane('locationPane').style.zIndex = 500;

            // --- 3. DEFINE & ADD LAYERS ---
            const orderedOverlayControls = {};
            let tontitLayerForBounds = null;

            // -- RASTER LAYERS --
            const backgroundMapBounds = [[6569968.0, 20032.0], [7819248.0, 740928.0]];
            if (backgroundMapBounds && Array.isArray(backgroundMapBounds) && backgroundMapBounds.length === 2) {
                const backgroundLayer = L.imageOverlay('./Taustakartta_320.png', backgroundMapBounds, { pane: 'backgroundPane' });
                orderedOverlayControls['Taustakartta'] = backgroundLayer;
            } else {
                console.warn("Background map bounds invalid or missing:", backgroundMapBounds);
            }

            const detailedMapBounds = [[6695999.75, 380000.25], [6701999.75, 386000.25]];
            if (detailedMapBounds && Array.isArray(detailedMapBounds) && detailedMapBounds.length === 2) {
                const detailedLayer = L.imageOverlay('./L4143B.png', detailedMapBounds, { pane: 'detailedMapPane' }).addTo(map);
                orderedOverlayControls['Tarkka taustakartta'] = detailedLayer;
            } else {
                console.warn("Detailed map bounds invalid or missing:", detailedMapBounds);
            }

            const hiresMapBounds = [[6699146.0, 380742.5], [6700331.5, 381913.5]];
            if (hiresMapBounds && Array.isArray(hiresMapBounds) && hiresMapBounds.length === 2) {
                const hiresLayer = L.imageOverlay('./background_map.png', hiresMapBounds, { pane: 'hiresMapPane' }).addTo(map);
                orderedOverlayControls['Ilmakuva'] = hiresLayer;
            } else {
                console.warn("High-res map bounds invalid or missing:", hiresMapBounds);
            }

            // -- VECTOR LAYERS --
            let tontitGeoJson;
            try {
                tontitGeoJson = JSON.parse(document.getElementById('tontit-data').textContent);
            } catch (e) {
                console.error("Failed to parse tontit GeoJSON:", e);
                tontitGeoJson = { type: "FeatureCollection", features: [] };
            }
            const tontitLayer = L.geoJSON(tontitGeoJson, {
                coordsToLatLng: coordsToLatLng,
                pane: 'tontitPane',
                style: {"color": "#e2a03b", "fillOpacity": 0.2, "weight": 2},
                onEachFeature: (f, l) => {
                    if (f.properties && f.properties.title && f.properties.text) {
                        l.bindPopup(`<b>${f.properties.title}</b><br>${f.properties.text}`);
                    } else if (f.properties && f.properties.tontti_name) {
                        l.bindPopup(`<b>${f.properties.tontti_name}</b>`);
                    } else if (f.properties && f.properties.Nimi) {
                        l.bindPopup(`<b>Tontti ${f.properties.Nimi}</b>`);
                    }
                }
            });
            if (tontitGeoJson.features.length > 0) {
                tontitLayer.addTo(map);
                orderedOverlayControls['Tontit'] = tontitLayer;
                tontitLayerForBounds = tontitLayer;
            } else {
                console.warn("No features in tontit GeoJSON");
            }

            // -- TONTTI LOGO LAYER --
            const tonttiLogoGroup = L.featureGroup().addTo(map);
            tontitGeoJson.features.forEach(feature => {
                if (feature.properties && feature.properties.logo && feature.geometry && feature.geometry.coordinates) {
                    const coords = feature.properties.logo_bounds;
                    if (coords && Array.isArray(coords) && coords.length === 2) {
                        const logoLayer = L.imageOverlay(`./logos/${feature.properties.logo}`, coords, { pane: 'tonttiLogoPane' });
                        tonttiLogoGroup.addLayer(logoLayer);
                    } else {
                        console.warn(`Invalid logo bounds for tontti ${feature.properties.Nimi}`);
                    }
                }
            });
            if (tonttiLogoGroup.getLayers().length > 0) {
                orderedOverlayControls['Tontti Logot'] = tonttiLogoGroup;
            } else {
                console.warn("No tontti logos added");
            }

            let roadGeoJson;
            try {
                roadGeoJson = JSON.parse(document.getElementById('road-data').textContent);
            } catch (e) {
                console.error("Failed to parse road GeoJSON:", e);
                roadGeoJson = { type: "FeatureCollection", features: [] };
            }
            const roadLayer = L.geoJSON(roadGeoJson, {
                coordsToLatLng: coordsToLatLng,
                pane: 'roadPane',
                style: {"color": "#FFFFFF", "opacity": 0.8, "weight": 3}
            });
            if (roadGeoJson.features.length > 0) {
                roadLayer.addTo(map);
                orderedOverlayControls['Tie'] = roadLayer;
            } else {
                console.warn("No features in road GeoJSON");
            }

            let contoursGeoJson;
            try {
                contoursGeoJson = JSON.parse(document.getElementById('contours-data').textContent);
            } catch (e) {
                console.error("Failed to parse contours GeoJSON:", e);
                contoursGeoJson = { type: "FeatureCollection", features: [] };
            }
            const contoursLayer = L.geoJSON(contoursGeoJson, {
                coordsToLatLng: coordsToLatLng,
                pane: 'contoursPane',
                style: {"color": "#87CEFA", "weight": 1},
                onEachFeature: (f, l) => {
                    if (f.geometry && f.geometry.coordinates && f.geometry.coordinates[0] && f.geometry.coordinates[0].length > 2) {
                        l.bindPopup(`Korkeus: ${f.geometry.coordinates[0][2]} m`);
                    }
                }
            });
            if (contoursGeoJson.features.length > 0) {
                contoursLayer.addTo(map);
                orderedOverlayControls['Korkeuskyrt'] = contoursLayer;
            } else {
                console.warn("No features in contours GeoJSON");
            }

            // -- GEOLOCATION LAYER --
            const userLocationGroup = L.featureGroup({ pane: 'locationPane' }).addTo(map);
            orderedOverlayControls['Oma Sijainti'] = userLocationGroup;

            // --- 4. ADD LAYER CONTROL ---
            if (Object.keys(orderedOverlayControls).length > 0) {
                L.control.layers(null, orderedOverlayControls, { collapsed: false }).addTo(map);
            } else {
                console.warn("No layers added to layer control");
            }

            // --- 5. SET MAP VIEW ---
            if (tontitLayerForBounds && tontitLayerForBounds.getBounds().isValid()) {
                map.fitBounds(tontitLayerForBounds.getBounds());
            } else {
                console.warn("No valid bounds for tontit layer, setting default view");
                map.setView([0, 0], 1);
            }

            // --- 6. GEOLOCATION LOGIC ---
            map.on('locationfound', e => {
                const mapCoords = proj4(proj4_WGS84, proj4_ETRS_TM35FIN, [e.latlng.lng, e.latlng.lat]);
                userLocationGroup.clearLayers();
                L.marker(coordsToLatLng(mapCoords)).addTo(userLocationGroup)
                    .bindPopup("Olet " + e.accuracy.toFixed(0) + " metrin steell tst.").openPopup();
            });
            map.on('locationerror', e => {
                console.warn("Geolocation failed:", e.message);
            });
            map.locate({ setView: false, maxZoom: 16 });

            console.log("Map script finished successfully.");
        } catch (e) {
            console.error("A critical error occurred:", e);
            document.body.innerHTML = `<div class="error-message"><h1>Karttaa ei voitu ladata</h1><p>Tapahtui virhe: ${e.message}</p><p>Tarkista selaimen konsoli (F12) saadaksesi listietoja.</p></div>`;
        }
    });
    </script>
</body>
</html>
